import React, { Fragment, useState } from 'react';
// import { registar_datos } from '../servicios/contactServicio';

const Contact = () => {
  // crear State
  const [contact, actualizarContact] = useState({
    name: '',
    email: '',
    phoneNumber: '',
    message: '',
  });

  // const actualizarContact = () => {
  //   console.log('funciona');
  // };

  return (
    <Fragment>
      <section id='contact'>
        <h2>CONTACT ME</h2>
        <form>
          <div>
            <input
              id='nameTxt'
              type='text'
              placeholder='Name'
              className='border-input'
            />
          </div>
          <div>
            <input
              id='emailTxt'
              type='email'
              placeholder='Email'
              className='border-input'
              onChange={actualizarContact}
            />
          </div>
          <div>
            <input
              id='phoneNumberTxt'
              type='tel'
              placeholder='Phone Number'
              className='border-input'
              onChange={actualizarContact}
            />
          </div>
          <div>
            <input
              id='messageTxt'
              type='Message'
              placeholder='Message'
              className='border-input'
              onChange={actualizarContact}
            />
          </div>
          <div>
            <button id='btnSend' onClick={() => obtenerDatos()}>
              SEND
            </button>
          </div>
        </form>
      </section>
    </Fragment>
  );
};

export default Contact;
